// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/// @title HAI Token
/// @notice ERC-20 token powering the HavnAI protocol with governance-managed emission.
contract HAI {
    /// @notice Mapping that stores account balances.
    mapping(address => uint256) private _balances;
    /// @notice Mapping that stores allowances granted to spenders.
    mapping(address => mapping(address => uint256)) private _allowances;

    /// @notice Total supply of tokens in circulation.
    uint256 private _totalSupply;

    /// @notice Token metadata name.
    string public constant name = "HavnAI";
    /// @notice Token metadata symbol.
    string public constant symbol = "HAI";
    /// @notice Token decimals as per ERC-20 specification.
    uint8 public constant decimals = 18;

    /// @notice Address of contract governance.
    address public governance;
    /// @notice Optional emission controller allowed to mint in addition to governance.
    address public emitter;

    /// @notice Emitted when tokens are moved between accounts.
    event Transfer(address indexed from, address indexed to, uint256 value);
    /// @notice Emitted when an allowance is granted or updated.
    event Approval(address indexed owner, address indexed spender, uint256 value);
    /// @notice Emitted when the emitter role is updated.
    event EmitterUpdated(address indexed newEmitter);
    /// @notice Emitted when governance is transferred.
    event GovernanceUpdated(address indexed newGovernance);

    /// @param initialGovernance Address that receives governance rights.
    /// @param initialEmitter Address capable of minting tokens alongside governance.
    constructor(address initialGovernance, address initialEmitter) {
        governance = initialGovernance == address(0) ? msg.sender : initialGovernance;
        emitter = initialEmitter;
    }

    /// @notice Returns the total amount of tokens in circulation.
    function totalSupply() external view returns (uint256) {
        return _totalSupply;
    }

    /// @notice Reads the balance of an account.
    function balanceOf(address account) external view returns (uint256) {
        return _balances[account];
    }

    /// @notice Moves tokens from caller to recipient.
    function transfer(address to, uint256 amount) external returns (bool) {
        _transfer(msg.sender, to, amount);
        return true;
    }

    /// @notice Reads allowance from owner to spender.
    function allowance(address owner, address spender) external view returns (uint256) {
        return _allowances[owner][spender];
    }

    /// @notice Approves spender to transfer tokens on sender's behalf.
    function approve(address spender, uint256 amount) external returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }

    /// @notice Moves tokens using an allowance previously granted by `from`.
    function transferFrom(address from, address to, uint256 amount) external returns (bool) {
        uint256 currentAllowance = _allowances[from][msg.sender];
        require(currentAllowance >= amount, "HAI: allowance exceeded");

        unchecked {
            _approve(from, msg.sender, currentAllowance - amount);
        }
        _transfer(from, to, amount);
        return true;
    }

    /// @notice Mints new tokens to `to`. Callable by governance or emitter.
    function mint(address to, uint256 amount) external {
        require(msg.sender == governance || msg.sender == emitter, "HAI: unauthorized mint");
        _mint(to, amount);
    }

    /// @notice Burns tokens from the caller's balance.
    function burn(uint256 amount) external {
        _burn(msg.sender, amount);
    }

    /// @notice Updates the emitter role. Governance-only action.
    function setEmitter(address newEmitter) external {
        require(msg.sender == governance, "HAI: not governance");
        emitter = newEmitter;
        emit EmitterUpdated(newEmitter);
    }

    /// @notice Transfers governance to a new address.
    function setGovernance(address newGovernance) external {
        require(msg.sender == governance, "HAI: not governance");
        require(newGovernance != address(0), "HAI: zero governance");
        governance = newGovernance;
        emit GovernanceUpdated(newGovernance);
    }

    function _transfer(address from, address to, uint256 amount) internal {
        require(to != address(0), "HAI: transfer to zero");
        uint256 balance = _balances[from];
        require(balance >= amount, "HAI: insufficient balance");

        unchecked {
            _balances[from] = balance - amount;
        }
        _balances[to] += amount;
        emit Transfer(from, to, amount);
    }

    function _mint(address to, uint256 amount) internal {
        require(to != address(0), "HAI: mint to zero");
        _totalSupply += amount;
        _balances[to] += amount;
        emit Transfer(address(0), to, amount);
    }

    function _burn(address from, uint256 amount) internal {
        uint256 balance = _balances[from];
        require(balance >= amount, "HAI: burn exceeds balance");
        unchecked {
            _balances[from] = balance - amount;
        }
        _totalSupply -= amount;
        emit Transfer(from, address(0), amount);
    }

    function _approve(address owner, address spender, uint256 amount) internal {
        require(owner != address(0) && spender != address(0), "HAI: approve zero");
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }
}

contracts/PayoutSplitter.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import {ExecutionLog} from "./ExecutionLog.sol";
import {WorkflowRegistry} from "./WorkflowRegistry.sol";
import {HAI} from "./HAI.sol";

/// @title PayoutSplitter
/// @notice Splits $HAI fees between creators, contributors, validators, and treasury per workflow configuration.
contract PayoutSplitter {
    /// @notice Basis points denominator shared with registry.
    uint16 public constant BPS = 10_000;

    /// @notice Stable reference to $HAI token.
    HAI public immutable hai;
    /// @notice Reference to execution log.
    ExecutionLog public immutable executionLog;
    /// @notice Reference to workflow registry.
    WorkflowRegistry public immutable registry;

    /// @notice Governance controller for treasury and overrides.
    address public governance;
    /// @notice Treasury address receiving protocol share.
    address public treasury;

    /// @notice Tracks whether a job has been settled.
    mapping(bytes32 => bool) public jobSettled;
    /// @notice Maps upstream asset identifiers to recipient wallets.
    mapping(bytes32 => address) public assetRecipient;

    event GovernanceUpdated(address indexed newGovernance);
    event TreasuryUpdated(address indexed newTreasury);
    event AssetRecipientUpdated(bytes32 indexed assetId, address indexed recipient);
    event PayoutSettled(bytes32 indexed jobId, bytes32 indexed workflowId, uint256 totalFee);

    error AlreadySettled();
    error Unauthorized();
    error InvalidOverrides();
    error MissingRecipient();

    constructor(HAI haiToken, ExecutionLog log, WorkflowRegistry reg, address initialTreasury) {
        require(address(haiToken) != address(0), "Splitter: HAI zero");
        hai = haiToken;
        executionLog = log;
        registry = reg;
        governance = msg.sender;
        treasury = initialTreasury;
    }

    /// @notice Settles payouts for a validated job.
    /// @dev Assumes this contract already holds the fee amount in $HAI.
    function settlePayout(
        bytes32 jobId,
        address nodeRecipient,
        address[] calldata validatorRecipients,
        bytes32[] calldata overrideAssetIds,
        address[] calldata overrideRecipients
    ) external {
        if (jobSettled[jobId]) revert AlreadySettled();
        ExecutionLog.ExecutionRecord memory record = executionLog.getExecution(jobId);
        jobSettled[jobId] = true;

        (WorkflowRegistry.Workflow memory wf, WorkflowRegistry.Dependency[] memory deps) = registry.getWorkflow(
            record.workflowId
        );
        require(!wf.flagged, "Splitter: workflow flagged");

        WorkflowRegistry.RoyaltyRoute memory route = wf.route;
        uint256 totalFee = record.fee;
        require(hai.balanceOf(address(this)) >= totalFee, "Splitter: insufficient balance");

        _transferOrRevert(wf.creator, (totalFee * route.creatorBps) / BPS);

        uint256 nodeShare = (totalFee * route.nodeBps) / BPS;
        if (nodeShare > 0) {
            _transferOrRevert(nodeRecipient, nodeShare);
        }

        _distributeUpstream(
            deps,
            (totalFee * route.upstreamBps) / BPS,
            overrideAssetIds,
            overrideRecipients
        );

        _distributeValidators(validatorRecipients, (totalFee * route.validatorBps) / BPS);

        uint256 treasuryShare = (totalFee * route.treasuryBps) / BPS;
        if (treasuryShare > 0 && treasury != address(0)) {
            _transferOrRevert(treasury, treasuryShare);
        }

        emit PayoutSettled(jobId, record.workflowId, totalFee);
    }

    /// @notice Updates governance authority.
    function setGovernance(address newGovernance) external {
        if (msg.sender != governance) revert Unauthorized();
        require(newGovernance != address(0), "Splitter: zero governance");
        governance = newGovernance;
        emit GovernanceUpdated(newGovernance);
    }

    /// @notice Sets the treasury address for protocol fees.
    function setTreasury(address newTreasury) external {
        if (msg.sender != governance) revert Unauthorized();
        treasury = newTreasury;
        emit TreasuryUpdated(newTreasury);
    }

    /// @notice Registers a wallet for a dependency asset.
    function setAssetRecipient(bytes32 assetId, address recipient) external {
        if (msg.sender != governance) revert Unauthorized();
        assetRecipient[assetId] = recipient;
        emit AssetRecipientUpdated(assetId, recipient);
    }

    function _distributeUpstream(
        WorkflowRegistry.Dependency[] memory deps,
        uint256 upstreamPool,
        bytes32[] calldata overrideAssetIds,
        address[] calldata overrideRecipients
    ) internal {
        if (upstreamPool == 0 || deps.length == 0) {
            return;
        }
        if (overrideAssetIds.length != overrideRecipients.length) revert InvalidOverrides();

        for (uint256 i = 0; i < deps.length; i++) {
            WorkflowRegistry.Dependency memory dep = deps[i];
            address recipient = assetRecipient[dep.assetId];
            for (uint256 j = 0; j < overrideAssetIds.length; j++) {
                if (overrideAssetIds[j] == dep.assetId) {
                    recipient = overrideRecipients[j];
                    break;
                }
            }
            if (recipient == address(0)) revert MissingRecipient();
            uint256 share = (upstreamPool * dep.weightBps) / BPS;
            if (share > 0) {
                _transferOrRevert(recipient, share);
            }
        }
    }

    function _distributeValidators(address[] calldata recipients, uint256 pool) internal {
        if (pool == 0 || recipients.length == 0) {
            return;
        }
        uint256 share = pool / recipients.length;
        require(share > 0, "Splitter: validator share zero");
        for (uint256 i = 0; i < recipients.length; i++) {
            _transferOrRevert(recipients[i], share);
        }
    }

    function _transferOrRevert(address to, uint256 amount) internal {
        if (amount == 0) return;
        require(to != address(0), "Splitter: transfer zero");
        bool ok = hai.transfer(to, amount);
        require(ok, "Splitter: transfer failed");
    }
}

contracts/StakingManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import {HAI} from "./HAI.sol";

/// @title StakingManager
/// @notice Bonds and slashes stake for HavnAI nodes and validators.
contract StakingManager {
    /// @notice $HAI token reference used for staking.
    HAI public immutable hai;

    /// @notice Governance authority.
    address public governance;
    /// @notice Minimum stake required for node operators.
    uint256 public minNodeStake;
    /// @notice Minimum stake required for validators.
    uint256 public minValidatorStake;
    /// @notice Time required before stake withdrawals become available.
    uint256 public unbondingPeriod;

    /// @notice Role enumeration for stakers.
    enum Role {
        None,
        Node,
        Validator
    }

    /// @notice State snapshot for each staker.
    struct StakeInfo {
        uint256 amount;
        uint256 unlockTimestamp;
        Role role;
        bool active;
    }

    mapping(address => StakeInfo) public stakes;

    event GovernanceUpdated(address indexed newGovernance);
    event StakeBonded(address indexed operator, Role indexed role, uint256 newAmount);
    event StakeUnbondRequested(address indexed operator, uint256 unlockTimestamp);
    event StakeWithdrawn(address indexed operator, uint256 amount);
    event StakeSlashed(address indexed operator, uint256 penalty, address indexed recipient);
    event ParametersUpdated(uint256 minNodeStake, uint256 minValidatorStake, uint256 unbondingPeriod);

    error Unauthorized();
    error InvalidRole();
    error CooldownActive();
    error InsufficientStake();

    constructor(HAI haiToken, uint256 nodeStake, uint256 validatorStake, uint256 cooldown) {
        require(address(haiToken) != address(0), "Staking: HAI zero");
        hai = haiToken;
        governance = msg.sender;
        minNodeStake = nodeStake;
        minValidatorStake = validatorStake;
        unbondingPeriod = cooldown;
    }

    /// @notice Bonds stake for a given role.
    function bondStake(uint256 amount, Role role) external {
        if (role != Role.Node && role != Role.Validator) revert InvalidRole();
        if (amount == 0) revert InsufficientStake();

        StakeInfo storage info = stakes[msg.sender];
        if (!info.active) {
            info.role = role;
            info.active = true;
        } else if (info.role != role) {
            revert InvalidRole();
        }

        uint256 newAmount = info.amount + amount;
        info.amount = newAmount;

        uint256 requiredStake = role == Role.Node ? minNodeStake : minValidatorStake;
        if (newAmount < requiredStake) revert InsufficientStake();

        bool ok = hai.transferFrom(msg.sender, address(this), amount);
        require(ok, "Staking: transfer failed");
        emit StakeBonded(msg.sender, role, newAmount);
    }

    /// @notice Initiates unbonding; stake becomes withdrawable after cooldown.
    function requestUnbond() external {
        StakeInfo storage info = stakes[msg.sender];
        if (!info.active) revert InsufficientStake();
        info.active = false;
        info.unlockTimestamp = block.timestamp + unbondingPeriod;
        emit StakeUnbondRequested(msg.sender, info.unlockTimestamp);
    }

    /// @notice Withdraws stake after cooldown has elapsed.
    function withdrawStake() external {
        StakeInfo storage info = stakes[msg.sender];
        if (info.active) revert CooldownActive();
        if (info.amount == 0) revert InsufficientStake();
        if (block.timestamp < info.unlockTimestamp) revert CooldownActive();

        uint256 amount = info.amount;
        info.amount = 0;
        info.role = Role.None;
        info.unlockTimestamp = 0;

        bool ok = hai.transfer(msg.sender, amount);
        require(ok, "Staking: withdraw failed");
        emit StakeWithdrawn(msg.sender, amount);
    }

    /// @notice Slashes stake for misbehavior by sending penalty to recipient.
    function slash(address operator, uint256 penalty, address recipient) external {
        if (msg.sender != governance) revert Unauthorized();
        StakeInfo storage info = stakes[operator];
        if (info.amount < penalty) revert InsufficientStake();
        if (recipient == address(0)) revert Unauthorized();

        info.amount -= penalty;
        bool ok = hai.transfer(recipient, penalty);
        require(ok, "Staking: slash transfer failed");

        emit StakeSlashed(operator, penalty, recipient);
    }

    /// @notice Updates system parameters.
    function setParameters(uint256 nodeStake, uint256 validatorStake, uint256 cooldown) external {
        if (msg.sender != governance) revert Unauthorized();
        minNodeStake = nodeStake;
        minValidatorStake = validatorStake;
        unbondingPeriod = cooldown;
        emit ParametersUpdated(nodeStake, validatorStake, cooldown);
    }

    /// @notice Transfers governance role.
    function setGovernance(address newGovernance) external {
        if (msg.sender != governance) revert Unauthorized();
        require(newGovernance != address(0), "Staking: zero governance");
        governance = newGovernance;
        emit GovernanceUpdated(newGovernance);
    }
}

